import React from 'react';
import { useParams, useNavigate } from 'react-router-dom';
import '../styles/DisasterDetail.css';

const disasterData = {
  earthquake: {
    title: 'Earthquake Safety',
    video: '/videos/earthquake.mp4',
    stats: [
      { label: 'Annual Casualties', value: '20,000+' },
      { label: 'Economic Impact', value: '$500B' },
      { label: 'High Risk Zones', value: '29 States' }
    ],
    precautions: [
      'Drop, Cover, and Hold On',
      'Stay away from windows and exterior walls',
      'If outdoors, move to open areas',
      'Be prepared for aftershocks',
      'Have an emergency kit ready'
    ],
    news: [
      {
        title: 'New Early Warning System Deployed',
        date: '2024-01-15',
        image: '/images/news/earthquake-1.jpg'
      },
      // Add more news items
    ]
  },
  // Add data for other disasters
};

function DisasterDetail() {
  const { type } = useParams();
  const navigate = useNavigate();
  const disaster = disasterData[type];

  if (!disaster) {
    return <div>Disaster type not found</div>;
  }

  return (
    <div className="disaster-detail">
      <div className="disaster-hero">
        <video autoPlay muted loop>
          <source src={disaster.video} type="video/mp4" />
        </video>
        <div className="disaster-hero-content">
          <h1>{disaster.title}</h1>
          <p>Learn about safety measures and precautions</p>
        </div>
      </div>

      <div className="disaster-content">
        <div className="disaster-stats">
          {disaster.stats.map((stat, index) => (
            <div key={index} className="stat-card slide-up">
              <div className="stat-number">{stat.value}</div>
              <div className="stat-label">{stat.label}</div>
            </div>
          ))}
        </div>

        <div className="precautions">
          <h2>Safety Precautions</h2>
          <div className="precautions-list">
            {disaster.precautions.map((precaution, index) => (
              <div key={index} className="precaution-item fade-in">
                <div className="precaution-icon">
                  <i className="fas fa-check"></i>
                </div>
                <p>{precaution}</p>
              </div>
            ))}
          </div>
        </div>

        <div className="news-section">
          <h2>Latest News</h2>
          <div className="news-grid">
            {disaster.news.map((item, index) => (
              <div key={index} className="news-card slide-up">
                <img src={item.image} alt={item.title} className="news-image" />
                <div className="news-content">
                  <div className="news-date">{item.date}</div>
                  <h3>{item.title}</h3>
                </div>
              </div>
            ))}
          </div>
        </div>

        <div className="navigation-buttons">
          <button 
            className="nav-button"
            onClick={() => navigate('/')}
          >
            Back to Home
          </button>
          <button 
            className="nav-button"
            onClick={() => {
              const disasters = ['earthquake', 'tsunami', 'drought', 'forest-fire'];
              const currentIndex = disasters.indexOf(type);
              const nextIndex = (currentIndex + 1) % disasters.length;
              navigate(`/disaster/${disasters[nextIndex]}`);
            }}
          >
            Next Disaster
          </button>
        </div>
      </div>
    </div>
  );
}

export default DisasterDetail;
